import React from 'react';
import { Link } from 'react-router-dom';

const Profile = () => {
    return (
        <Link to="#" className='px-3 py-3 mb-[2px] rounded-3xl duration-150 ease-linear flex items-center text-link gap-x-4 font-normal group hover:bg-linkHover'>
            <div className='group-hover:scale-[1.1] duration-150'>
                <div className='w-6 h-6 rounded-full overflow-hidden'>
                    <img src="/img/profile.jpeg" className='object-contain' alt='profile' />
                </div>
            </div>
            <span>Profil</span>
        </Link>
    );
};

export default Profile;
